import { useParams } from "react-router-dom";
import useProfile from "../../hooks/useProfile";
/* import useServices from "../../hooks/useServices" */
import { Loading } from "../loading/Loading";
import { ErrorMessage } from "../errorMessage/ErrorMessage";
import useReplies from "../../hooks/useReplies"




/* ME QUEDO AQUÍ PARA LOS REPLIES, HICE UN NUEVO ENDPOINT */
export const ReplyServices = () => {
    const { id } = useParams();
    const { replies } = useReplies(id)
    const { loading, error } = useProfile();
    console.log("replies", replies);
    console.log("replies.data", replies.data);


    if (loading) return <Loading />;
    if (error) return <ErrorMessage message={error} />;

    return (<div>{replies.observations}</div>)
}
